//Archivo de const con las urls para aguilizar la programacion 
export const home = '/';
export const recipeList = '/organizacion';
export const recipebyid = '/organizacion/:id';
export const recipenew = '/organizacion/new';
export const recipeof = id => '/organizacion/'+ id;
export const editrecipeof = id => '/organizacion/'+ id +"/edit";
